import React from "react";
import { Tab, TabList, TabPanel, TabPanels, Tabs } from "@chakra-ui/tabs";
import Results from "./Results";
import Schedule from "./Schedule";
import Tables from "./Tables";

const ScheduleTabs = ({ upcoming, results, division }) => {
  const tabStyleProps = {
    _selected: { color: "black", backgroundColor: "white" },
    bg: "brand.400",
  };
  return (
    <Tabs align="center" isFitted variant="enclosed">
      <TabList>
        <Tab {...tabStyleProps}>Schedule</Tab>
        <Tab _selected={{ color: "white", backgroundColor: "black" }}>
          Results
        </Tab>
        <Tab _selected={{ color: "white", backgroundColor: "black" }}>
          Tables
        </Tab>
      </TabList>
      <TabPanels>
        <TabPanel>
          <Schedule games={upcoming} />
        </TabPanel>
        <TabPanel>
          <Results results={results} />
        </TabPanel>
        <TabPanel>
          <Tables division={division} />
        </TabPanel>
      </TabPanels>
    </Tabs>
  );
};

export default ScheduleTabs;
